import 'rc-time-picker/assets/index.css';

import React from 'react';
import axios from 'axios';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import courses_data from './data/courses.json';
import terms_data from './data/terms.json';
import TimePicker from 'rc-time-picker';

import './App.css';			

class App extends React.Component {

  constructor(props){
	  super(props);
  }

  handleClick(e) {
	  e.preventDefault();
	  axios.get('')
	    .then(res => console.log(res));
  }


  render(){
    const courses = courses_data.map((course) => {return (<option>{course}</option>); });
    const terms = terms_data.map((term) => {return (<option key={term.id}>{term.name}</option>); });

	  return(
	    <Container className="p-3">
		    <Jumbotron>
		      <h3>Which courses do you want?</h3>

		      <Form>
			      <Form.Group as={Row} controlId="term">
			        <Form.Label column sm={1}>Term</Form.Label>
			        <Col sm={4}>
				        <Form.Control as="select" column sm={12}>
				          <option></option>
                  {terms}
				        </Form.Control>
			        </Col>
			      </Form.Group>

			      <Form.Group as={Row} controlId="time">
			        <Form.Label column sm={0.2}>From</Form.Label>
			        <Col sm={1}>
                <TimePicker showSecond={false} minuteStep={15}/>
			        </Col>
              <Form.Label column sm={1}>To</Form.Label>
			        <Col sm={1}>
                <TimePicker showSecond={false} minuteStep={15}/>
			        </Col>
			      </Form.Group>

			      <Form.Group as={Row} controlId="course_name">
			        <Form.Label column sm={1}>Course Name</Form.Label>
			        <Col sm={4}>
				        <Form.Control as="select">
				          <option></option>
                  {courses}
				        </Form.Control>
			        </Col>
			      </Form.Group>

			      <Button onClick={this.handleClick} variant="primary" type="submit">Submit</Button>

		      </Form>

		    </Jumbotron>
	    </Container>
	  );
  }

}

export default App;
